import Footer from "../component/footer"
import Header from "../component/header"

const Contactpage = ()=>{
    return(
        <>
            {<Header/>}
            <div id="contact">This is Contact page content</div>
            {<Footer/>}
          
        </>
    )
}
export default Contactpage
